import React, { useState } from 'react';
import './Panier.css';
// import panier from './icones/panier.png';
// import play from './icones/play.png'; 

function Panier({ panier }) {
    

    return (
      <div>
        <h2>Mon panier</h2>
        <ul>
          {panier.map((son) => (
            <li key={son.id}>{son.titre}</li>
          ))}
        </ul>
      </div>
    );
  }
  
  export default Panier;
